Cuba, Basketball and Betrayal

Sociopolitical Documentary hosted by Ade Adepitan, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2013 - English narration


Information
------------------------------

Paralympian wheelchair basketball star Ade Adepitan is granted access on a rare scale to some of Cuba's most famous basketball stars, to investigate why some of them have defected to the USA just as the country seems to be opening up. Adepitan and director David Fuller travel to Ciego De Avila, six hours east of Havana, and home to the best basketball team in Cuba. Many of the Ciego Buffalo stars are in the national team, but some of them have made headlines for reasons not to do with performance on the basketball court.

